    "Bayesian Framework based Damage Segmentation (BFDS) with Time-Reversal Tomography
    (TRT) for Damage Characterization in Complex Aircraft Structures Project",nt"tracking_summary":
    {ntt"total": 5,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-05-07T01:22:54.782803",nt"name": "bayesian-framework-based-damage-segmentation-bfds-with-time-reversal-tomography-trt-for-da",nt"isopen":
    true,nt"url": null,nt"notes": "To meet the NASA's need for innovative technologies
    that decrease turn-around time for inspections and assessments for safe operations
    of aircraft and spacecraft,  X-wave Innovations, Inc. (XII), teaming up with Prof.
    Fuh-Gwo Yuan at North Carolina State University (NCSU), proposes to develop an innovative
    guided-wave based Time-Reversal Tomography (TRT) technology and Bayesian Framework
    based Damage Segmentation (BFDS) technology for finite-size damage detection and
    characterization in complex structures.  This framework provides a means for evaluation
    of the Model-Assisted Probability of Detection (MAPOD) and Confidence Level (CL)
    for damage characterization in the context of Structural Health Monitoring (SHM).",nt"license_title":
